import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import ReportTrackingPage from './components/ReportTrackingPage';
import ProfilePage from './components/ProfilePage';
import ContractorsPage from './components/ContractorsPage';
import ProtectedRoute from './components/ProtectedRoute'; // <-- make sure this path is correct

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>

          {/* Wrap these in ProtectedRoute */}
          <Route path="/dashboard" element={
            <ProtectedRoute>
              <ReportTrackingPage />
            </ProtectedRoute>
          } />
          <Route path="/contractors" element={
            <ProtectedRoute>
              <ContractorsPage />
            </ProtectedRoute>
          } />
          <Route path="/profile" element={
            <ProtectedRoute>
              <ProfilePage />
            </ProtectedRoute>
          } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
